script: |
  super -f text -I q10288.spq | sort > q10288.out

inputs:
  - name: q10288.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE + col1 NOT BETWEEN + col0 * - ( + + col2 ) / - col2 AND + + col2 + + CAST ( NULL AS INTEGER );
  - name: tab2

outputs:
  - name: q10288.out
    data: |
      75	67	58
